My First Sex Teacher - Vanilla DeVille 

Release Date: March 07, 2011

Dane has come after class to Prof. Deville's class because she wanted him to get some studying done. The Professor is in a strange mood, as she is just staring at Dane. It seems that she just got her tenure at the university based on her performance and the student questionnaires that gave her favorable marks. She was curious to read them, and somehow obtained copies of them all. What makes her interested in Dane is the fact that he turned in a very negative questionnaire about her and her teaching style. She is pissed and calls him out. Actually she just grabs him and throws him up against the desk. She is going to get him on her side by any means necessary. At least he has to give her an A for Effort!
